<html>
	<body>
		<style>
			.link {
				font-family: monospace;
				width: 100%;
				border: solid 1px;
			}
			.link > * {
				display: flex;
				flex-direction: row;
			}
			.link > * > * {
				flex: 1;
			}
			.link .k {
				text-align: right;
				margin-right: 10px;
				font-weight: bold;
			}
			.link[data-bootloader=yes] {
				background-color: rgba(255,255,0,0.2);
			}
			.link[data-bootloader=no] {
				background-color: rgba(0,0,255,0.2);
			}
			.link[data-uploading=yes],
			.link[data-entering-bootloader-mode=yes],
			.link[data-exiting-bootloader-mode=yes]{
				background-color: rgba(255,0,0,0.2);
			}
		</style>
		<button id="verbose_on">verbose on</button>
		<button id="verbose_off">verbose off</button>
		<div id="links"></div>
		<pre id="log"></pre>
		<script src='https://cwilso.github.io/WebMIDIAPIShim/lib/WebMIDIAPI.js'></script>
		<script src="../build/qbmidi.js"></script>
		<script>
			qbmidi.init()
			qbmidi.verbose(true)
			document.getElementById('verbose_on').addEventListener('click', function() {
				qbmidi.verbose(true)
			})
			document.getElementById('verbose_off').addEventListener('click', function() {
				qbmidi.verbose(false)
			})

			setInterval(function(){
				const links = qbmidi.getLinks()
				const linkEls = document.getElementById('links').querySelectorAll('.link')
				linkEls.forEach(el => {
					const runtimeId = el.dataset.runtimeId
					if(!qbmidi.getLinkByRuntimeId(runtimeId)){
						document.getElementById('links').removeChild(el)
					}
				})
				links.forEach(link => {
					(link =>{
						let el = document.getElementById(`link-${link.runtimeId}`)
						if (!el) {
							el = document.createElement('div')
							el.className = 'link'
							el.id = `link-${link.runtimeId}`
							const enterBootloader = () => {
								qbmidi.enterBootloaderMode(link)
							}
							const exitBootloader = () => {
								qbmidi.exitBootloaderMode(link)
							}
							const uploadHex1 = () => {
								qbmidi.uploadHexToLink(link, RESET_FIRMWARE1)
							}
							const uploadHex2 = () => {
								qbmidi.uploadHexToLink(link, RESET_FIRMWARE2)
							}


							el.innerHTML = `
								<div class='runtimeId'><div class='k'>runtimeId</div><div class='v'></div></div>
								<div class='created'><div class='k'>created</div><div class='v'></div></div>
								<div class='uuid'><div class='k'>uuid</div><div class='v'></div></div>
								<div class='uploading'><div class='k'>uploading</div><div class='v'></div></div>
								<div class='enteringBootloaderMode'><div class='k'>enteringBootloaderMode</div><div class='v'></div></div>
								<div class='exitingBootloaderMode'><div class='k'>exitingBootloaderMode</div><div class='v'></div></div>
								<div class='bootloader'><div class='k'>bootloader</div><div class='v'></div></div>
								<div class='method'><div class='k'>method</div><div class='v'></div></div>
								<div class='buttons'>
									<button class='enterBootloader'>enter bootloader</button>
									<button class='exitBootloader'>exit bootloader</button>
									<button class='uploadHex1'>firmware 1</button>
									<button class='uploadHex2'>firmware 2</button>
								</div>
							`
							document.getElementById('links').appendChild(el)

							el.querySelector('.enterBootloader').addEventListener('click', enterBootloader)
							el.querySelector('.exitBootloader').addEventListener('click', exitBootloader)
							el.querySelector('.uploadHex1').addEventListener('click', uploadHex1)
							el.querySelector('.uploadHex2').addEventListener('click', uploadHex2)
						}
						el.dataset.runtimeId = link.runtimeId
						el.dataset.created = link.created
						el.dataset.uuid = link.uuid
						el.dataset.uploading = link.uploading ? 'yes' : 'no'
						el.dataset.enteringBootloaderMode = link.enteringBootloaderMode ? 'yes' : 'no'
						el.dataset.exitingBootloaderMode = link.exitingBootloaderMode ? 'yes' : 'no'
						el.dataset.bootloader = link.bootloader ? 'yes' : 'no'
						el.dataset.method = link.method

						el.querySelector('.runtimeId .v').innerHTML = link.runtimeId
						el.querySelector('.created .v').innerHTML = link.created
						el.querySelector('.uuid .v').innerHTML = link.uuid
						el.querySelector('.uploading .v').innerHTML = link.uploading
						el.querySelector('.enteringBootloaderMode .v').innerHTML = link.enteringBootloaderMode
						el.querySelector('.exitingBootloaderMode .v').innerHTML = link.exitingBootloaderMode
						el.querySelector('.bootloader .v').innerHTML = link.bootloader
						el.querySelector('.method .v').innerHTML = link.method
					})(link)
				})
			}, 200)
		</script>
